import React from 'react';
//import './Card.css';

const Card = ({image, displayOverlay, toggleOverlay}) => (
    <div className="Card-container" onClick={toggleOverlay}>
        <img src={image} />
        {displayOverlay && (
            <div className="Card-overlay" />
        )}
    </div>
);

export default Card;
